import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { getOneAnime } from "../../api";

function OneAnime() {

    const {id} = useParams()
    const {data, setData} = useState([])


    useEffect(() => {
        getOneAnime(id)
            .then(response => {
                setData(response.data)
            })

            .catch(err => {
                console.log(err)
            })
    })

    console.log(data)

    return (  
        <>
            <div>One anime!</div>
        </>
    );
}

export default OneAnime;
